  FaTwitter
} from "react-icons/fa";

const Footer = () => {
  return (
    <>
     <body>
    <div class="c">
      <div class="drop drop1"></div>
      <div class="drop drop2"></div>
      <div class="text-c">
        <h1>DROPMORPHISM</h1>
        <p>Both the drops are created using CSS</p>
      </div>
    </div>
  </body>
    </>
  );
};

export default Footer;
